static int pack_can_0x5ec_megasquirt_dash4(can_obj_megasquirt_simplified_dash_broadcast_h_t *o, uint64_t *data) {
	assert(o);
	assert(data);
	register uint64_t x;
	register uint64_t m = 0;
	/* VSS1: start-bit 7, length 16, endianess motorola, scaling 0.1, offset 0 */
	x = ((uint16_t)(o->can_0x5ec_megasquirt_dash4.VSS1)) & 0xffff;
	x <<= 48; 
	m |= x;
	/* tc_retard: start-bit 23, length 16, endianess motorola, scaling 0.1, offset 0 */
	x = ((uint16_t)(o->can_0x5ec_megasquirt_dash4.tc_retard)) & 0xffff;
	x <<= 32; 
	m |= x;
	/* launch_timing: start-bit 39, length 16, endianess motorola, scaling 0.1, offset 0 */
	x = ((uint16_t)(o->can_0x5ec_megasquirt_dash4.launch_timing)) & 0xffff;
	x <<= 16; 
	m |= x;
	*data = reverse_byte_order(m);
	o->can_0x5ec_megasquirt_dash4_tx = 1;
	return 8;
}

static int unpack_can_0x5ec_megasquirt_dash4(can_obj_megasquirt_simplified_dash_broadcast_h_t *o, uint64_t data, uint8_t dlc, dbcc_time_stamp_t time_stamp) {
	assert(o);
	assert(dlc <= 8);
	register uint64_t x;
	register uint64_t m = reverse_byte_order(data);
	if (dlc < 8)
		return -1;
	/* VSS1: start-bit 7, length 16, endianess motorola, scaling 0.1, offset 0 */
	x = (m >> 48) & 0xffff;
	o->can_0x5ec_megasquirt_dash4.VSS1 = x;
	/* tc_retard: start-bit 23, length 16, endianess motorola, scaling 0.1, offset 0 */
	x = (m >> 32) & 0xffff;
	o->can_0x5ec_megasquirt_dash4.tc_retard = x;
	/* launch_timing: start-bit 39, length 16, endianess motorola, scaling 0.1, offset 0 */
	x = (m >> 16) & 0xffff;
	o->can_0x5ec_megasquirt_dash4.launch_timing = x;
	o->can_0x5ec_megasquirt_dash4_rx = 1;
	o->can_0x5ec_megasquirt_dash4_time_stamp_rx = time_stamp;
	return 8;
}

