int unpack_message(can_obj_megasquirt_simplified_dash_broadcast_h_t *o, const unsigned long id, uint64_t data, uint8_t dlc, dbcc_time_stamp_t time_stamp) {
	assert(o);
	assert(id < (1ul << 29)); /* 29-bit CAN ID is largest possible */
	assert(dlc <= 8);         /* Maximum of 8 bytes in a CAN packet */
	switch (id) {
	case 0x5e8: return unpack_can_0x5e8_megasquirt_dash0(o, data, dlc, time_stamp);
	case 0x5e9: return unpack_can_0x5e9_megasquirt_dash1(o, data, dlc, time_stamp);
	case 0x5ea: return unpack_can_0x5ea_megasquirt_dash2(o, data, dlc, time_stamp);
	case 0x5eb: return unpack_can_0x5eb_megasquirt_dash3(o, data, dlc, time_stamp);
	case 0x5ec: return unpack_can_0x5ec_megasquirt_dash4(o, data, dlc, time_stamp);
	default: break; 
	}
	return -1; 
}

